import React from "react";

function SideMenu() {

    const filterContent= (event) => {
        console.log(event.ta)
    }
    return (
        <div class="sidebar" id="sidenav" style="display: none;">
            <div id="leftmenu">
                <div id="leftmenuinner">
                <input class="searchinput" placeholder="Search..." onInput={filterContent}/>
                <h2>Menu</h2>
                <a href="">DIY & house decor</a>
                <a href="">Cocktails</a>
                <a href="">Music</a>
                <a href="">Kids stuff</a>
                </div>
            </div>
        </div>
    )
}

export default SideMenu;
